import React from "react";
import "./App.css";
import Home from "./Containers/Home/Home";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import PopularDishes from "./Containers/PopularDishes";

function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route path="/" exact element={<Home />} />
          <Route path="/" exact element={<PopularDishes />} />
        </Routes>
        <Routes>
          <Route path="/pop" exact element={<PopularDishes />} />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
